          </svg>
          <span className="font-semibold text-xl tracking-tight text-white">
            Gopher Blog
          </span>
        </div>

        <div className="flex items-center">
          <a
            href="/"
            className="text-base text-white hover:text-gray-200 mr-4"
          >
            Home
          </a>
          <a
            href="/create"
            className="text-base text-white hover:text-gray-200 mr-4"
          >
            Create Post
          </a>
          {!userData && (
            <a
              href="/register"
              className="text-base text-white hover:text-gray-200 mr-4"
            >
              Register
            </a>
          )}
          <a
            href="/personal"
            className="text-base text-white hover:text-gray-200 mr-4"
          >
            My Post
          </a>
          <div
            onClick={logOut}
            className="text-base text-white hover:text-gray-200 cursor-pointer"
          >
            {userData ? "Log Out" : "Login"}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
